const videos = [
	{
		name:'Замыкание От и До',
		duration: 15,
		id: 1,
	},
	{
		name: 'Roadmap',
		duration: 15,
		id: 2,
	},
	{
		name: 'Frontend',
		duration: 15,
		id: 3,
	},
	{
		name: 'Frontend 2',
		duration: 10,
		id: 4,
	}
]

export function VideoList() {
	return (
		<>
		<h1>VideoList</h1>
		{
			videos.map((video) => {
				return (
					<div>
						<p>{video.name}</p>
						<p>{video.duration}</p>
						<button>Like!</button>
					</div>
				)
			})
		}
		</>
	)
}
